import React from "react";
import { Parallax, ParallaxBanner } from "react-scroll-parallax";

import img from "../3_images/2_theInitiative/bg_initiative-banner-blur.jpg";
import img1 from "../3_images/2_theInitiative/bg_initiative-banner.jpg";

export default function TheOriginalSix() {
  return (
    <div>
      <ParallaxBanner
        className="your-class"
        layers={[
          {
            image: { img },
            amount: 0.1
          },
          {
            image: "https://foo.com/bar.png",
            amount: 0.2
          }
        ]}
        style={{
          height: "500px"
        }}
      >
        <h1>Banner Children</h1>
      </ParallaxBanner>
    </div>
  );
}
